import React from "react";
import { users } from "../../data/data";
const Table = () => {
  const header = [
    "image",
    "name",
    "role",
    "messages sent",
    "warnings",
    "status",
  ];
  const title = "User Manager";
  return (
    <div className="pnl convex-1 p-3">
      <div className="container-fluid">
        <div className="row no-gutters justify-content-around">
          <div className="col-12 text-center lead">User Manager</div>
          <div className="col-12"></div>
          {Object.keys(users[0]).map((x, i) => {
            return (
              <div className="col-auto" key={`tbl-clmn-${i}`}>
                <div
                  className="row no-gutters align-items-cente"
                  style={{ height: "40px" }}
                >
                  {header[i]}
                </div>
                {users.map((y, j) => {
                  return (
                    <div
                      key={`clmn-${i}-row-${j}-tbl-${title}`}
                      className="row no-gutters align-items-center"
                      style={{ height: "30px" }}
                    >
                      {x === "image" ? (
                        <div style={{ width: "30px", heigth: "30px" }}>
                          <img src={y[x]} className="img-fluid"></img>
                        </div>
                      ) : (
                        y[x]
                      )}
                    </div>
                  );
                })}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default Table;
